import React from "react";
import ReactDOM from "react-dom";
import img from "./Mep";


function Card(props){
  return
  <>
  <img src={props.img1} alt="nothing to show"/>
<img src={props.img2} alt="nothing to show"/>
<img src={props.img3} alt="nothing to show"/>
  </>
}


ReactDOM.render(
<div>

<Card img1="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQPxhiZcMvhaJLG5r2g2a41EHLnIxYWxoq_Lw&usqp=CAU"
/>
<Card img2="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRZYMA-_5zLCAVSi7A4UOZiu5VamTsWCYlMRw&usqp=CAU" />
<Card img3='https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSrABG6od_yVCwenX7T1einPeabrncQVLbDmA&usqp=CAU'/>




</div>,
document.getElementById('root'));
